using Ambev.DeveloperEvaluation.Domain.Entities;
using Ambev.DeveloperEvaluation.Domain.Enums;
using Microsoft.AspNetCore.Identity;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using System.Text.RegularExpressions;

namespace Ambev.DeveloperEvaluation.ORM.Mapping;

public class ProductConfiguration : IEntityTypeConfiguration<Product>
{
    public void Configure(EntityTypeBuilder<Product> builder)
    {
        builder.ToTable("Products");

        builder.HasKey(u => u.Id);
        builder.Property(u => u.Id).HasColumnType("uuid").HasDefaultValueSql("gen_random_uuid()");

        builder.Property(u => u.Title).IsRequired().HasMaxLength(100);
        builder.Property(u => u.Description).IsRequired().HasMaxLength(1000);
        builder.Property(u => u.Category).IsRequired().HasMaxLength(100);
        builder.Property(u => u.Image).HasColumnType("text").IsRequired();
        builder.Property(u => u.Price).HasColumnType("money").IsRequired();

        builder.HasData(
            new Product
            {
                Id = new Guid("10ABA601-FF1C-499D-9482-A148E52A6824"),
                Title = "Budweiser",
                Description = "O processo de produção da Budweiser é diferenciado, por utilizar lascas de Beechwood (madeira especial) durante os processos de fermentação e maturação. O resultado é um cerveja de sabor único e com equilíbrio perfeito: marcante no início e suave no final",
                Category = "Beer",
                Image = "",
                Price = 3.25M,
                CreatedAt = new DateTime(2025, 2, 9, 13, 17, 8, 105, DateTimeKind.Utc)
            },
            new Product
            {
                Id = new Guid("8EB3305D-BE7F-4170-A731-5AA65AA9248A"),
                Title = "Original",
                Description = "Perfeito equilíbrio entre sabor e refrescância",
                Category = "Beer",
                Image = "",
                Price = 3.99M,
                CreatedAt = new DateTime(2025, 2, 9, 13, 17, 8, 105, DateTimeKind.Utc)
            },
            new Product
            {
                Id = new Guid("8A7D6AA0-3E97-46A5-A569-B6A51633E45A"),
                Title = "Colorado",
                Description = "Mais saborosa com toque generoso de ingredientes brasileiros",
                Category = "Beer",
                Image = "",
                Price = 10.35M,
                CreatedAt = new DateTime(2025, 2, 9, 13, 17, 8, 105, DateTimeKind.Utc)
            }
        );
    }
}
